import React from "react";
import { Text, Input, Grid, Button } from "../elements";

const Login = (props) => {
  return (
    <React.Fragment>
      <Grid padding="16px">
        <Text size="32px" bold>
          로그인
        </Text>

        <Grid padding="16px 0px">
        <Input
            label="아이디"
            placeholder="아이디를 입력해주세요."
            _onChange={() => {
              console.log("닉네임 입력 됐다!!");
            }}
          />
        </Grid>
        <Grid padding="16px 0px">
        <Input
            label="비밀번호"  
            placeholder="비밀번호를 입력해주세요."
            _onChange={() => {
              console.log("비밀번호 입력 됐다!!");
            }}
          />
        </Grid>

        <Button
          text="로그인하기"
          _onClick={() => {
            console.log("로그인 했어!");
          }}
        ></Button>
      </Grid>
    </React.Fragment>
  );
};

export default Login;
